import React from "react";
import { Routes, Route, BrowserRouter } from "react-router-dom";
import "./App.css";
import { Header } from "./components/Header";
import { ClientPage } from "./Pages/ClientPage";
import { LoginPage } from "./Pages/LoginPage";
import { MyPage } from "./Pages/MyPage";
import { AddItemPage } from "./Pages/AddItemPage";
import { SignUpPage } from "./Pages/SignUpPage";

export function App() {
  const yahooAPI = fetch(
    `https://shopping.yahooapis.jp/ShoppingWebService/V3/itemSearch?appid=dj00aiZpPUZPU3h2a21KeG5pVSZzPWNvbnN1bWVyc2VjcmV0Jng9NDQ-&query=${search}&genre_category_id=11561&price_from=1000&price_to=5000&results=100`,
    { mode: "cors" }
  );
  return (
    <>
      <Header />
      <BrowserRouter>
        <Routes>
          <Route
            exact
            path="/items"
            element={<ClientPage yahooAPI={yahooAPI} />}
          />
          <Route exact path="/" element={<LoginPage />} />
          <Route exact path="/signin" element={<LoginPage />} />
          <Route exact path="/additem" element={<AddItemPage />} />
          <Route exact path="/signup" element={<SignUpPage />} />
          <Route exact path="/mypage" element={<MyPage />} />
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
